import React from 'react';
import styled from "@emotion/styled";

const SubmitButton = styled.button`
margin-top:10px;
display: block;
height: 40px;
width: 100%;
font-size: inherit;
background-color: black;
border-radius: 4px;
opacity: 0.5 : 1;
color: white;
font-weight: 600;
cursor: pointer;
`;

export default SubmitButton;
